func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}

func min(a, b int) int {
	if a < b {
		return a
	}
	return b
}

func maxArea(height []int) int {
	dp := make([][]int, len(height))
	for i := 0; i < len(height); i++ {
		dp[i] = make([]int, len(height))
	}

	for sz := 1; sz < len(height); sz++ {
		for i := 0; i+sz < len(height); i++ {
			n := max(dp[i][i+sz-1], dp[i+1][i+sz])
			v := min(height[i], height[i+sz]) * sz
			dp[i][i+sz] = max(n, v)
		}
	}

	return dp[0][len(height)-1]
}

